  return (
    <BrowserRouter>
      <div className="App">
        <h1>Hello World</h1>
        <Route path="/people/">
          <Main />
        </Route>
        <Route path="people/:id">
          <Detail />
        </Route>
        {/* <Route path="/people/:id/edit">
